// === frontend/src/pages/Results.js ===
import React from 'react';

function Results() {
  const results = JSON.parse(localStorage.getItem('results') || '[]');

  return (
    <div>
      <h2>Your Best Neighborhood Matches</h2>
      <ul>
        {results.map((n, i) => (
          <li key={i}>{n.name} - Score: {n.score}</li>
        ))}
      </ul>
    </div>
  );
}

export default Results;
